column5:
return user on watch record (#3445)

as per https://github.com/elastic/elasticsearch/pull/31873

(cherry picked from commit 7f99a91b7d746ef2def0d97bc2eb81b95b2a51c6)

Dateformat epoch_mills is mispelled

Following nest call fails:
elasticClient.CreateIndex("testindex",
                        descriptor =>
                            descriptor.Mappings(mappings => mappings
                                .Map<EventMapping>(md => md
                                    .Properties(props => props
                                        .Date(d => d.Name("Time").Format(DateFormat.epoch_millis))
...

```
{
  "error": {
    "root_cause": [
      {
        "type": "mapper_parsing_exception",
        "reason": "Failed to parse mapping [event]: Invalid format: [epoch_mills]: Illegal pattern component: p"
      }
    ],
    "type": "mapper_parsing_exception",
    "reason": "Failed to parse mapping [event]: Invalid format: [epoch_mills]: Illegal pattern component: p",
    "caused_by": {
      "type": "illegal_argument_exception",
      "reason": "Invalid format: [epoch_mills]: Illegal pattern component: p",
      "caused_by": {
        "type": "illegal_argument_exception",
        "reason": "Illegal pattern component: p"
      }
    }
  },
  "status": 400
}
```

Fixed the syntax of QueryRaw as it didn't work

//When I try this 
var response = client.Search(func);

//This worked if the definition of func was
Func<SearchDescriptor<dynamic>, SearchDescriptor<dynamic>> func = s => s
               .AllTypes()
               .From(0)
               .Size(5)
               .QueryRaw(@"{""match_all"": {} }")
               ;

//This didn't work if the definition of func was
            Func<SearchDescriptor<dynamic>, SearchDescriptor<dynamic>> func = s => s
                .AllTypes()
                .From(0)
                .Size(10)
                .QueryRaw("\"match_all\" : { }")
);

merged DSL and client projects;
Started on query DSL finally!
Focusing on unit testing query responses first.
